<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>97</title>
    <style>
        * {
            padding: 0;
            margin: 0;
            box-sizing: border-box;
        }
        html, body {
            height: 100%;
        }
        body {
            background-color: #2f393a;
            font-family: Arial, sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            padding: 4% 0;
        }
        .container {
            width: 350px;
            max-width: 95%;
            margin: 0 auto;
        }
        .main {
            display: flex;
            align-items: center;
            justify-content: space-between;
        }
        .logo {
            width: 50%;
            max-width: 150px;
        }
        .logo img {
            width: 100%;
            /*transform: scale(-1, 1);*/
            height: 100%;
            /*height: 100%;*/
        }
        .banner {
            width: 50%;
            /*max-width: 150px;*/
        }
        .banner img {
            width: 100%;
            height: 100%;
        }
        form {
            margin-top: 16px;
        }
        .input-group, .button-group {
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
        }

        .button-group {
            margin-top: 20px;
        }

        .input {
            display: block;
            width: 100%;
            min-height: 50px;
            border-radius: 5px;
            padding: 10px 15px;
            font-size: 18px;
            line-height: 1.25;
            margin-top: 8px;
        }
        label, .btn-label {
            color: #ffffff;
        }
        .btn-label span {
            color: #169852;
            font-weight: bold;
        }
        .button {
            display: flex;
            align-items: center;
            justify-content: center;
            background-color: #00c85e;
            width: 100%;
            min-height: 50px;
            border-radius: 5px;
            text-decoration: none;
            color: #ffffff;
            margin-top: 28px;
        }
        .price {
            margin-top: 6px;
            font-family: Arial, sans-serif;
            color: #ffffff;

        }
        /*@media (max-height: 550px) and (orientation: landscape) {*/
        /*    .banner, .logo {*/
        /*        width: auto;*/
        /*        height: 30vh;*/
        /*    }*/
        /*}*/
        @media (max-height: 550px) and (orientation: landscape) {
            .banner, .logo {
                display: none;
            }
        }
    </style>
</head>
